import React from "react";
import "./Login.scss";

export const Login = () => {
  return (
    <div className="Login">
      <form className="Login__Form">
        <div className="Login__Form__Box">
          <input placeholder="Email" className="Login__Form__Input"></input>
          <span className="Login__Form__Box__Highlight"></span>
          <span className="Login__Form__Box__Bar"></span>
          <label>Name</label>
        </div>
        <div className="Login__Form__Box">
          <input
            placeholder="Mot de passe"
            className="Login__Form__Box__Input"
          ></input>
          <span className="Login__Form__Box__Highlight"></span>
          <span className="Login__Form__Box__Bar"></span>
          <label>Name</label>
        </div>
      </form>
    </div>
  );
};

export default Login;
